(14, 'About  Asim''s Toy', 'about-asims-toy', NULL, 'Asim''s Toys &nbsp;is an importer and retailer of children ride on Toys\r\n						ABN: 30874827397\r\n				\r\n				\r\n				Asim''s Toys specialize in ride on Toys for children. We import our products to strict specifications, which our manufacturers produce for us with many improvements and upgrades than our competitors products have. our products comes with better quality batteries , Fuses ,Gear shifters ,CE Material  which means your ride on sold within the "European Conformity" (EEA) , CE Material   makes our  toys comply with the Toy Safety Directive and the cars  have more power, longer lasting drive time and battery life. Buy from Asim''s Toys and become one of our many satisfied customers, with help just a phone call away if you ever need it', NULL, NULL, NULL, NULL, '', '', '', 'active', 0, 0, '2016-02-23 18:30:17', '2016-08-09 16:08:01'),
(15, 'special', 'special', NULL, 'No Offer date', NULL, NULL, NULL, NULL, '', '', '', 'active', 0, 0, '2016-02-23 19:20:26', '2016-02-23 19:20:26'),
(16, 'Terms & Condition', 'terms-condition', NULL, '<h3>Warranty</h3>\r\n<p>The warranty period is from date of delivery and for domestic use only.\r\nWe offer a parts replacement warranty as described below.\r\nWe offer a six months parts replacement warranty only. In the event of a particular part failing, Asim''s Toys  will supply the parts required free of charge. In the event of an item not working after replacement parts are installed, the purchasee is responsible for the cost of returning the item to us. Postage costs will not be refunded byAsim''s Toys . See below notes regarding Toys electrics. Batteries and battery chargers are not covered under the warranty and they must be handled and charged correctly.</p>\r\n<h3>RETURN CONDITIONS</h3>\r\n<ul>\r\n<li>No refunds offered if you have changed your mind about the goods after 7 days .</li>\r\n<li>Shipping costs are non-refundable.</li>\r\n<li>We only allow exchange within 7 days of items received except specified on the listing.</li>\r\n<li> Return postage fee will be at buyer’s expense. Please contact us before returning anything.</li>\r\n<li>Returned products must be properly packed and returned in their original packaging.</li>\r\n<li>If returned items are found to be not faulty a flat service fee of $20 applied.</li>\r\n<li>If we cannot repair the product, we will offer replacement or a similar one </li>\r\n<li>Returned items with signs of abuse or intentional damage will be refused and returned to sender at buyer''s cost.</li>\r\n<li>Negligence, misuse or minor scratch is not covered under this policy.\r\n</li>\r\n</ul>\r\n<p>Any refund or replacement request must be done so in writing within 7 days of receipt of your order with a valid reason before this request can be honoured. It is also your responsibility to confirm all parts / products are received in your order within 7 Days. Failure to do this may void any refund or replacement!</p>\r\n<p>Please supply the original order confirmation in any correspondence.\r\nAn investigation on our part will be conducted to confirm this request before refund or replacement is awarded.\r\nAny refunds will be deposited into the account nominated in the original order confirmation</p>\r\n<p>For products returned to Asim''s Toys  the Customer shall be responsible for all costs and expenses (including insurance) of having the item returned to us . If an order is cancelled after dispatch the Customer shall be responsible for all transport costs incurred by the Transport Company in dispatching the item and having it returned to the our warehouse. The Customer''s payment will be refunded within 30 days, subject only to deduction of any direct costs of transport and insurance incurred by the Transport Company in relation to the return of the goods, as well as transport and insurance costs incurred in the original delivery, upon receipt of the goods and inspection as to their suitability for re-sale</p>', NULL, NULL, NULL, NULL, '', '', '', 'active', 0, 0, '2016-02-23 19:33:56', '2016-02-23 19:45:18'),
(17, 'Warranty', 'warranty', NULL, 'The warranty period is from date of delivery and for domestic use only. We offer a parts replacement only warranty as described below. <br><br>\r\nIn the event of a particular part failing, Asim''s Toys will supply the parts required free of charge. In the event of an item not working after replacement parts are installed, the Buyer is responsible for the cost of returning the item to us. Postage costs will not be refunded by Asim''s Toys. See below notes regarding Toys electrics. <br><br>\r\nBatteries and battery chargers are not covered under the warranty and they must be handled and charged correctly.<br><br>\r\n\r\nIF the goods supplied to you are damaged Or faulty on delivery, you should notify us in writing via the enotes section of the website within 7 working days , return postage  fee will be at buyer’s expense , postage costs are non refundable for returned items so please ensure you are purchasing the correct vehicle before placing your order.<br><br>\r\n\r\nFor any item that is damaged that does not affect the safety of the product and the customer wants us to repair it, the customer will have to pay the postage costs back to Asim’s Toys . We do this to keep costs down and provide long term low prices.  <br><br>\r\n\r\n<b> What is not covered under warranty? </b><br><br>\r\n\r\n1. Batteries and battery chargers are not covered under the warranty and they must be handled and charged correctly.<br><br>\r\n\r\n2. This warranty does not apply to any defect in the goods arising from fair wear and tear, Any Body Damage, , lack of maintenance ,willful damage, natural disaster,  accident, negligence by you or any third party, failure to follow the Supplier´s instructions, or any alteration or repair carried out without the Supplier´s approval, The warranty is considered void if the item has been modified, altered or tampered with by a person (or persons) not authorised by Asim’s Toys  to provide service (not including standard periodic maintenance). <br><br>\r\n\r\n3.	Negligence, misuse or minor scratch is not covered under this policy:<br>\r\nPlease note that most of our ride-on products we sell are creating with a process used by the manufacturers that we sell, the process involves blowing sheets of plastic with hot air to make the moulds required for the production of the car. Sometimes the moulds can have minor scuffs, dents or very small scratches caused by material flowing in the air as the plastic is very hot this can mark the body of the car. This does NOT cause any materialistic flaws within the body and does not affect the strength or durability of the body. They are just minor cosmetic flaws, Asim’s Toys will not accept any returns back due to this and this no reason to claim the item as faulty. <br><br>\r\n\r\n4. Broken Gear Box– A number our cars have forward and reverse gears. Please instruct your child to stop the car prior to putting the car in reverse as with a normal car you will damage/break the gears if you change from forward to reverse without stopping the car. We will send out spares to solve this problem if it happens by mistake but will not replace the car if the problem not solve. The new gears need to be added into the motor and take about 5 minutes (5 screws to remove) to add.<br><br>\r\n\r\n5. Although we take all damages seriously we cannot replace every small non critical part. For any item that is damaged that does not affect the safety of the product and the customer wants us to repair it, the customer will have to pay the postage costs back to Asim’s Toys . We do this to keep costs down and provide long term low prices.    The vehicles can develop intermittent electrical issues on the add on features i.e radio / horn / music player which should be considered before choosing your model. These will not affect the driving of the vehicle and are not covered by warranty. <br><br>\r\n\r\n6. Parts purchases, consumable components, and accessories [such as chains, carry bags, batteries, Charger, steering wheel, hoses, grinding discs, mats, nets, belts, cables, wheels, blades, tubs, safety gear etc.] are not covered by our standard warranty once used. \r\n', NULL, NULL, NULL, NULL, '', '', '', 'active', 0, 0, '2016-02-23 19:45:55', '2016-05-13 05:42:14'),
(18, 'faq', 'faq', NULL, '<h3>Can I lay-by  </h3>\r\nContact us if you would like to set up a lay-by payment plan and provide your name, address, phone and email details. We are more than happy to accept part payments over a 8 Weeks period, To enter into the Lay by Agreement a non-refundable deposit of 10% of the total order is required at the beginning and once you pay  full amount on 8 weeks we ship your order otherwise if we not receive the full amount within 8 weeks we cancel your order .We will Endeavour to assist you in completing your Lay by such as payment reminders and extensions however we do reserve the right to cancel non-compliant orders. In this case any funds minus initial 10% deposit will be refunded to you.\r\n<h3>Can I leave the battery on charge for all day? </h3>\r\nNo, Battery charge time must not exceed 12 hours for first use  or permanent damage to the cells will occur. The battery should also be charged every time when ever it need for not more than 6 hours  .\r\n<h3>How fast will my ride on car go? </h3>\r\nThis will depend on the battery power. 6 Volt ride ons are more suited to the harder tarmac surfaces but will operate on grass at a slower pace.  A12 volt battery will operate the ride on at about 7 Km/h. A 24 volt will go about 9 Km/h .\r\n<h3>Is there much assembly required? </h3>\r\nAll products require some assembly depending on the model. Assembly takes about 20 to 30 mins. These cars come with a manual so you’ll have them up and running in no time!\r\nAssembly time - Approximately 60 - 90 minutes\r\nThese ride on cars require some components to be assembled. A relative degree of understanding instruction manuals and assembly techniques will be required to build this ride on car.&nbsp;<h3>What are the best surfaces for my ride on car to operate on? </h3>\r\n12 Volt and 24 volt ride on will go on most surfaces (tarmac, grass, gravel etc) , 6 Volt ride on are more suited to the harder tarmac surfaces but will operate on grass at a slower pace.\r\n<h3>What about your quality and warranty? </h3>\r\nWe have strict quality control system from material to finished products, before products being released from factory, our  Dept needs to do spot check strictly, and once products reaching your hands, please pay more attention on testing, you need to make sure all of them are all right in your hands. For defective or false products those are confirmed due to our own mistakes, we can replace and make up for your lost.\r\nAnd you know, toys do not like other electronic products, such as MP3, DVD ,  so we can not guarantee any years for these products, because they will be played by users, maybe they will be broken down after playing, but we can supply most of the spare parts for these broken models from your hands. Usually, they will be all right in correct operation.\r\nWe offer a six months parts replacement warranty only. In the event of a particular part failing, Asim''s Toys  will supply the parts required free of charge. In the event of an item not working after replacement parts are installed, the purchasee is responsible for the cost of returning the item to us. Postage costs will not be refunded byAsim''s Toys . See below notes regarding Toys electrics. Batteries and battery chargers are not covered under the warranty and they must be handled and charged correctly.', NULL, NULL, NULL, NULL, '', '', '', 'active', 0, 0, '2016-02-23 19:48:35', '2016-11-10 02:06:11'),
(19, 'contact', 'contact', NULL, 'If you have any enquiry about our products, please contact with us. OR you can call to 1300 566 662.', NULL, NULL, NULL, NULL, '', '', '', 'active', 0, 0, '2016-02-23 19:54:40', '2016-09-02 16:17:16'),
(21, 'Privacy Policy', 'privacy-policy', NULL, '<h5>Introduction and Your Agreement to this Privacy Policy :</h5>\r\nAsim’s Toys  (ABN : 308 748 273 97 ) is committed to responsibly managing personal information, including in accordance with the Australian Privacy Principles under the Privacy Act 1988 (Cth), collected from customers during the course of their dealings with us as a retailer of family related products and services.<br><br>\r\nThis policy will outline the following:<br><ul><li>\r\nWhat personal information is collected</li><li>How that personal information is collected during your dealings with us</li><li>What we do with any personal information received; and</li><li>	How we ensure that this information is treated in accordance with the Privacy Act.</li></ul><br>\r\nIf you provide us with any personal information, including in connection with the purchase of products and services from us or through your use of our website (www.asimstoys.com.au), you are deemed to agree to this Privacy Policy. Accordingly you should carefully read and ensure that you understand the provision of this Privacy Policy. If you do not agree to this Privacy Policy, you should not provide us with any personal information or access and use our website.<br>\r\n<h5>Collection of Information</h5>\r\nAt Asim’s toys we will only collect your personal information, such as name, address and telephone number or e-mail address and address , where necessary to provide you with our products and services relevant to you and your family. Privacy law requires us to collect personal information about you only from you if it is reasonably necessary to facilitate the functions or activities of  Asim’s Toys . You have no obligation to provide any information requested by Asim’s Toys , if you choose not to provide us with requested information however, we may not be able to provide you with those products or services that depend on the collection of that information, particularly if the collection of that information is required by the law.\r\n<br><h5>How Personal Information is Used</h5>\r\nPersonal information is usually only requested to allow us to provide our products and services to you. Some examples of where we may need to collect this information from you are credit card purchases through our website, warranties, home deliveries, refunds / exchanges, lay buys and website promotions or offers. Asim’s Toys  may also use your personal information to communicate to you our unique offers, promotions, product safety, product recalls and services. You can advise Asim’s Toys that you do not wish us to send that information to you other than the main use for which we collected your personal information. We may still use or disclose that information if: (i) we subsequently notify you of the intended use or disclosure and you do not object to that use or disclosure; (ii) we believe that the use or disclosure is reasonably necessary to assist a law enforcement agency or an agency responsible for government or public security in the performance of their functions; or (iii) we are required by law to disclose the information; or (iv) we or a vendor needs to contact you regarding product safety or a product recall.<br>\r\nIf you would like to: access, correct, amend or delete any personal information we have about you, register a complaint, or simply want more information contact our Privacy Compliance Officer at asimstoys@gmail.com or Contact us at 1300 566 662 <br>\r\n<h5>Security</h5>\r\nTo protect your personal information, we take reasonable precautions and follow industry best practices to make sure it is not inappropriately lost, misused, accessed, disclosed, altered or destroyed.<br>\r\nIf you provide us with your credit card information, the information is encrypted using secure socket layer technology (SSL) and stored with a AES-256 encryption Which is provided by Eway payment gateway.  Although no method of transmission over the Internet or electronic storage is 100% secure, we follow all requirements and implement additional generally accepted industry standards.<br>\r\n<h5>Website / Email-COOKIES</h5>\r\nOur website may contain links to other websites of interest. However, once you have used these links to leave our site, you should note that we do not have any control over that other website. Therefore, we cannot be responsible for the protection and privacy of any information which you provide whilst visiting such sites and such sites are not governed by this privacy statement. You should exercise caution and look at the privacy statement applicable to the website in question.<br>\r\n<h5>Access to Your Personal Information</h5>\r\nFor Privacy and accuracy information Asim’s Toys  relies on our customers to provide updates or changes to individual information. You may request access to your personal information held by Asim’s Toys  and request its correction by sending a signed request to the Privacy Officer at email address above. Asim’s Toys  will endeavour to respond within 14 days provided the information request meets the requirements under the Privacy Act and the Freedom of Information Act 1982 (Cth), and we can verify the individual making the request. For most requests your information will be provided free of charge, however it may be necessary to charge a reasonable fee if the request will take substantial time to complete.<br>\r\n<h5>Changes to this policy</h5>\r\nWe reserve the right to change, modify or update this policy at any time. We will notify you of these changes, modifications or updates from time to time by publishing the latest policy on our website.', NULL, NULL, NULL, NULL, '', '', '', 'active', 0, 0, '2016-08-23 02:15:19', '2016-08-23 03:26:41'),
(22, 'Delivery Policy', 'delivery-policy', NULL, '<h5>MOST SHIPPING RUNS ABOUT 4-7  DAYS to your door.<br>We ship to all the lower Rate </h5>\r\n<h5>Where do we deliver?</h5>\r\nAsim’s Toys  delivers only within Australia.<br>\r\nWe cannot accept orders from islands or Out of Australia  due to the high cost of delivering large items and the difficulty with arranging returns. \r\n<br>\r\n<h5>Our Couriers</h5>\r\nAsim’s Toys Australia uses a TNT road express freight to ensure your delivery is fast and affordable.<br><br>\r\n<h5>Shipping Fees</h5>Shipping fees are calculated based on the weight and dimensions of the products you order as well as your delivery location.<br><br>Shipping fees are shown in your cart once you have logged into your Asim’s toys  account. If you have previously registered with Us you can log in at anytime. First time shoppers will need to create an account with <a href="http://www.asimstoys.com.au" target="" rel="">www.asimstoys.com.au</a>  first and provide your delivery address.<br><br>\r\n<h5>Estimated Delivery Times</h5>The majority of orders are dispatched from our warehouses within 48 hours.<br>We estimate your order will be delivered to you within the below time period:<br><br>\r\nCapital Cities: 5 - 10 Days<br>\r\nOther Areas: 7 - 12 Days<br><br>\r\nWe will always do our best to deliver within the estimated timeframes but these they are not guaranteed. During Sale Events and Christmas additional delays may be experienced.<br>PO Boxes, Parcel Lockers &amp; Post Offices<br><br>Asim’s Toys  is unable to deliver PO Boxes, Parcel Lockers or Post Offices.<br>\r\n<h5>Delivery to Remote Areas</h5>If you live in a remote area of Australia and delivery is limited to your home address, our carriers will deliver your goods to the local depot or delivery location. If this is the case our Customer Service team will contact you in regards to collecting your goods from the nominated collection point. If you are concerned about this and not sure if you fall in one of these locations, contact our us  for  further assist you in understanding any restrictions that may be in place regarding delivery to your area.<br><h5>Receiving Your Order</h5>All orders must be signed for unless you have given specific Authority to Leave instructions. Please ensure there is someone available at the delivery address to sign for the delivery.<br>What if no one is available to sign for the delivery?<br><br>If you are not home to accept delivery our couriers will leave a calling card. If you receive a calling card you will need to call the relevant number and arrange another time for delivery. If you are not available to meet the courier to receive your item you will be charged a $30 re-delivery Fee, You can give us instructions at time of purchase were to leave the item if your not present , however Asim’s Toys  will not be held liable for any items which are stolen or have gone missing once the courier has Delivered the Item .', NULL, NULL, NULL, NULL, '', '', '', 'active', 0, 0, '2016-08-23 02:16:04', '2016-08-23 03:02:46'),
(23, 'Lay by', 'lay-by', NULL, '<div>LAY BY POLICY:</div><div><br></div><div>Now We are Happy to announce that we accepting lay by for Christmas .</div><div>We are more than happy to accept partial payments , To enter into the Lay by Agreement a non-refundable deposit of $50.00 of the total order is required at the beginning as Initial payment &nbsp;and once you pay full amount &nbsp;we ship your order , &nbsp;We will endevour to assist you in completing your Layby such as payment reminders and extensions however we do reserve the right to cancel non-compliant orders. In this case any funds minus initial $50.00 deposit will be refunded to you.</div><div><br></div><div>How To Setup Lay-By : &nbsp; &nbsp;&nbsp;</div><div><br></div><div><br></div><div>Browse through our available models . &nbsp; &nbsp; &nbsp;&nbsp;</div><div>While checkout ,Buyer &nbsp;would login to the system ( Create An account ) :</div><div>a. &nbsp; &nbsp;Registered member (if not then signup) &nbsp;</div><div>b. &nbsp; Initial Payment of Minimum $50 Required&nbsp;</div><div>c. &nbsp; After submitting the layby payment, Buyer &nbsp;will allow to view the transaction &nbsp;history, &nbsp;Asim toys will approve the partial payment &nbsp;&nbsp;</div><div>d. &nbsp; Every Time The buyer can Login and check The remaining balance For lay-by then Can make &nbsp;Payments as little or as big as you wish as long as the total balance is cleared by the end of Christmas &nbsp;period Or before .</div><div>e. &nbsp; Upon final Lay-by payment, delivery of your purchase will be within &nbsp;3-7 &nbsp;business .&nbsp;</div><div><br></div><div>If the Payments &nbsp;are not complete it by Christmas time will be cancel Your Order &nbsp;and no refund will be issue .&nbsp;</div>', NULL, NULL, NULL, NULL, '', '', '', 'active', 0, 0, '2016-09-05 16:37:35', '2016-09-05 16:59:26');
