(11, NULL, 9, 15, 'Special Product', 'special-product', 'thank&nbsp;', 'thank', 'inactive', NULL, 'Product', NULL, '80', '70', NULL, NULL, NULL, '9', 'no', 0, 0, '2016-07-09 16:44:33', '2016-08-12 17:33:31', 'No', 'uploads/product_image/281DSC_0041.JPG', 'uploads/product_image/thumb_253_DSC_0041.JPG', 'BMW', '2-seater', '6V', '', '#', 1, 0, '1.00', NULL, '1.00', '1.00', '1.00', 'none', '', 'no'),
(12, NULL, 3, 7, 'White 24 Volt BMW X7 Style big two seats  ,Rubber wheels, leather Seats ', 'white-24-volt-bmw-x7-style-big-two-seats-rubber-wheels-leather-seats', 'IN STOCK&nbsp;<br><br>Sale -White Colour &nbsp;$419.00 &nbsp;<br>White with Black leather seats , Rubber tires&nbsp;<br>The New 24 Volt 10Ah\r\nVersion (Bigger Batteries ) of the BMW X7 Style Kids Electric Car with Super\r\nbig two seats <br>Painted Vlack with Black Leather seats .<br>, EVA Foam wheels &nbsp;With Bluetooth Remote Control\r\n2.4G\r\n<br><br>&nbsp; &nbsp; The BMW X7 Style Big\r\nTwo Seater rechargeable 12 volt kids ride-on car is totally awesome. This model\r\nactually has rubber tires making this ride on car great on most surfaces It\r\nalso has 2 seats so your little one can take a friend along on the adventure. Includes\r\nFREE LEATHER SEAT! This is your opportunity to own this one of a kind Power\r\nCar. This sporty SUV design is the first thing that you will notice. A remote\r\ncontrol is included with the BMW X7 Style. This feature can be used to control\r\nthe car for younger riders and THEY CAN DRIVE IT TOO! There is a power button\r\nthat once pushed, there is a starting motor noise - hit the music button on the\r\nsteering wheel and the car plays music. This car is not like any other ride on\r\ncar on the market today. Also features working lights and built in music\r\nplayer.', '<span>*Electric\r\npedal controlled and 2.4G four-way remote controlled<br>\r\n*With MP3, USB,TF card socket, and adjustable volume<br>\r\n*With shock absorber<br>\r\n*Multifunctional steering wheel with music effects&nbsp;<br>\r\n*With battery indicator&nbsp;<br>\r\n*Doors can be open<br>\r\n*With Two seaters&nbsp;<br>\r\n*With electric steering<br>\r\n*Two motors<br>\r\n*Battery: 2*12V10AH<br>\r\n*With leather seat<br>\r\n*EVA tires&nbsp;<br>\r\n*4 wheel suspension system<br>\r\n*Electric turning system make control the steering wheel easier<br>\r\n* 2.4G bluetooth remote control system<br>\r\n*Colors: black,White&nbsp;<br>\r\n*Product size:145.5*94.2*61cm</span>', 'inactive', NULL, 'Product', NULL, '419.00', '419.00', NULL, NULL, NULL, '10', 'no', 0, 0, '2016-07-23 20:11:19', '2017-02-06 20:06:41', 'Yes', 'uploads/product_image/851Emulation BMW X7 (14).jpg', 'uploads/product_image/thumb_809_Emulation BMW X7 (14).jpg', 'BMW', '2-seater', '24V', '', '', 0, 0, '43.00', NULL, '155.00', '90.00', '65.00', 'none', '', 'no'),
(13, NULL, 3, 7, 'Pink Licensed Ford-Ranger kids Ride-on-Car Leather Seat', 'pink-licensed-ford-ranger-kids-ride-on-car-leather-seat', '<div><b>IN &nbsp;STOCK NOW&nbsp;<br><br>The High Version of Licensed Ford Ranger With Full Upgrades and Rubber Tires .<br></b><b><br></b><div>New Shipments and last before Christmas</div><div>Arriving 30th Of November (Hurry Up )</div>Our October shipment sold Out and new Shipments arriving 30th of November .<b>&nbsp;&nbsp;<br></b><div><b>&nbsp;( Painted Blue , Painted Black , White , Painted Pink&nbsp;)</b></div><br>&nbsp;( Eva Rubber Wheels , leather seats ,12Volt 10Ah , Metallic Colour&nbsp;, 2.4G&nbsp;Remote )<br><div><br>We Ship Australia Wide&nbsp;<br><br>.Features : ( Optional ; Black or Tan leather seats ) ,Key start , 2.4G Remote control , Metallic Colour , Slow Start , 10Ah )<br><br>Not only do the doors open on this Ford Kids 12v jeep but so does the bonnet and tailgate which is a first for ride on toys. This makes the pick up look and work just like a real car. Adding to the realism is the range of tech in the 12v car. This includes working LED lights, both front and rear, an mp3 speaker system with SD card storage and a shock absorber system giving a smooth ride.<br>Kids-12v-Blue-Ford-Ranger-Truck<br>To top it off the Large Licensed Ford Ranger 12v Kids Pick Up Truck Ride On is equipped with a parental remote option allowing you to take control of the action if your child wants to sit back and enjoy the adventure. This car comes with a rechargeable battery and mains charger so you can get driving right away!<br>Large Licensed Ford Ranger 12v Kids Pick Up Truck Ride On</div></div>', '<div>Eva Foam Rubber Wheels&nbsp;</div><div>Leather Seats&nbsp;</div><div>12v 10AH Rechargeable Battery</div><div>Speed Range: 3-7kmh</div><div>Patented Shock Absorber &amp; Spring Design</div><div>Battery Power Indicator</div><div>Parental Remote Option</div><div>Opening Doors / Bonnet / Tailgate</div><div>MP3 Connectivity</div><div>Key start&nbsp;</div><div>2 Forward Gears with 1 Reverse</div><div>Auto Brake</div><div>LED Lights Front, Rear and Fog</div><div>USB &amp; SD Card Sockets for MP3</div><div><br></div>', 'active', NULL, 'Product', NULL, '399.00', '399.00', NULL, NULL, NULL, '7', 'no', 0, 0, '2016-07-24 06:52:54', '2017-03-26 13:16:37', 'Yes', 'uploads/product_image/982image4.JPG', 'uploads/product_image/thumb_295_image4.JPG', 'Ford', '2-seater', '12V', '', '', 0, 0, '40.00', NULL, '140.00', '85.00', '65.00', 'Sale', '300.00', 'yes'),
(14, NULL, 3, 7, 'PINK 24 VOLT BMW X7 STYLE  TWO SEATS ,RUBBER WHEELS, LEATHER SEATS & REMOTE ', 'pink-24-volt-bmw-x7-style-two-seats-rubber-wheels-leather-seats-remote', 'In stock Now .<br>24 VOLT BMW X7 STYLE &nbsp;TWO SEATS ,RUBBER WHEELS, LEATHER SEATS &amp; REMOTE&nbsp;<br>With Black leather Seats .<br><br>The New 24 Volt 10Ah Version (Bigger Batteries ) of the BMW X7 Style Kids Electric Car with Super big two seats , EVA Foam wheels and leather Seats With Bluetooth Remote Control 2.4G &nbsp; The BMW X7 Style Big Two Seater rechargeable 12 volt kids ride-on car is totally awesome. This model actually has rubber tires making this ride on car great on most surfaces It also has 2 seats so your little one can take a friend along on the adventure. Includes FREE LEATHER SEAT! This is your opportunity to own this one of a kind Power Car. This sporty SUV design is the first thing that you will notice. A remote control is included with the BMW X7 Style. This feature can be used to control the car for younger riders and THEY CAN DRIVE IT TOO! There is a power button that once pushed, there is a starting motor noise - hit the music button on the steering wheel and the car plays music. This car is not like any other ride on car on the market today. Also features working lights and built in music player.', '*Electric pedal controlled and 2.4G four-way remote controlled<br>*With MP3, USB,TF card socket, and adjustable volume<br>*With shock absorber<br>*Multifunctional steering wheel with music effects&nbsp;<br>*With battery indicator&nbsp;<br>*Doors can be open<br>*With Two seaters&nbsp;<br>*With electric steering<br>*Two motors<br>*Battery: 2*12V10AH<br>*With leather seat<br>*EVA tires&nbsp;<br>*4 wheel suspension system<br>*Electric turning system make control the steering wheel easier<br>* 2.4G bluetooth remote control system<br>*Colors: black,White&nbsp;<br>*Product size:145.5*94.2*61cm', 'active', NULL, 'Product', NULL, '449.00', '449.00', NULL, NULL, NULL, '5', 'no', 0