(51, NULL, 3, 6, ' motorbike with lighting wheels,12 Volt ,(Two Seaters)', 'motorbike-with-lighting-wheels12-volt-two-seaters', '<h2><b><span class="wysiwyg-color-maroon"><u>Coolest kids ride on Car , motorbike with lighting wheels,12 Volt ,(Two Seaters)<br><br></u></span></b></h2><div><h3><u>The newest electric motorbike for kids</u></h3><h3><u>&nbsp;with 2 seats 12 Volt</u></h3><h3><br></h3><h3><div><u>&nbsp;Asim''s Toys</u></div><div><br></div><div></div></h3><h3><u>Order your 12v Harley Style Kids Electric Motorbike with Sidecar&nbsp;</u>Now a kids 12v motorbike is pretty cool, but add a sidecar and you are onto&nbsp;something special. This 12v Harley Style Kids Electric Motorbike with Sidecar&nbsp;is a great twist on normal ride on bikes, allowing two kids to ride it at the same&nbsp;time. As a large electric trike this is brilliant for all children thanks to its great&nbsp;stability. The bike comes with everything you need to get started including&nbsp;battery and mains charger.</h3><h3>This 12v bike includes plenty of ride on features to make this as realistic as&nbsp;possible. These include a two speed gearbox, working lights and sounds and&nbsp;there is even an mp3 speaker system letting you play all of your favourite&nbsp;songs. This kids electric bike with sidecar also has detailed graphics with an&nbsp;array of stickers for that genuine biker effect.The 2 x 6v batteries allows for speeds of nearly 5-7hm/h for a safe but fun ride&nbsp;and there’s also a reverse gear for backing out of sticky situations.12v Harley Style Kids Electric Motorbike with Sidecar Details:Features:</h3><h4><span><br><br><br></span></h4></div>', '<h4>Battery:2x6v7ah</h4><h4><br>Motor:2x35w</h4><h4><br>MP3 Socket and volume adjust function</h4><h4><br>One button Start<br>led lights</h4><h4>Colour : White</h4><h4><br>Forward and back</h4><h4><br>Size:123*72*50cm</h4><h4><br>Weight capacity:30kgs</h4><h4><br>Two Seaters&nbsp;</h4>', 'inactive', NULL, 'Product', NULL, '149.00', '149.00