(56, NULL, 3, 7, 'Authentic official Licensed Ferrari LaFerrari Remote Control Ride On Car With Vertical Doors With Leather Seat .', 'authentic-official-licensed-ferrari-laferrari-remote-control-ride-on-car-with-vertical-doors-with-leather-seat', '<h2><b>IN STOCK NOW&nbsp;</b></h2><br><br>The Ultimate Gift .Authentic Official Licensed Ferrari LaFerrari Remote Control Ride On Car With Vertical Doors With Leather Seat .<span>Pre-Order : Please note the Stock arriving 30th of November . Price $399.00<br>Visit the below link to Pre-order</span><span>You don''t need to pay Full amount , only $50 To secure it , check out with our Partial payment System and Pay it off Slowly&nbsp;<br>Lay by till Christmas</span>The Special Edition Remote Control LaFerrari has superb detail, is a licensed and genuine Ferrari replica. Our version of the Ride On LaFerrari comes with all of the authentic badges, LED lights, MP3 player input, sounds and now with our exclusive Ferrari push button start and twin 12 volt motors. It features a Full Function 2.4G (same technology as Bluetooth) Remote Control for parents whose kids cannot yet reach the foot pedal or otherwise maneuver the car. It can also be fully operated by your toddler using steering wheel and foot pedal or driven by parent via four-way remote. It comes complete with a 12V battery and charger.', 'Specifications :<br>Single Wide Seat<br>Leather Seats&nbsp;<br>RC Ride On LaFerrari:<br>Rechargeable 12V 7Ah Battery<br>Dual 12V Upgraded Motor<br>2 Speeds Forward &amp; 1 Reverse<br>Length: 44", Width: 22"<br>Wireless 2.4G Remote Control<br>Working Front Lights &amp; Turn Signals<br>Push Button Start With Start Up Sounds<br>MP3 Player Connection<br>Cushioned Seat for Extra Comfort<br>Real Horn, Engine Sounds, Volume Control<br>Perfect For 2-6 Years Of Age<br>Weight Capacity of 65 Lbs.<br>Adjustable Seat Belt&nbsp;<br>Foot Pedal Accelerator .', 'active', NULL, 'Product', NULL, '399.00', '399.00', NULL, NULL, NULL, '30', 'no', 0, 0, '2016-