(65, NULL, 3, 7, 'Luxury 4 WD Emulation Ford Style (NEW ) With MP4LCD Screen ( Painted Black )', 'luxury-4-wd-emulation-ford-style-new-with-mp4lcd-screen-painted-black', '<h3><u><b>Pre-Order : Please note this is Pre-order listing for stock arriving 20-25th of Jan 2017<br><br></b></u></h3><br><b>Power Wheels&nbsp;</b><b>Luxury 4 WD Emulatio</b><b>n Ford Style (NEW ) With MP4 LCD Screen , Four Motors 4 X 45 Watt .Leather seat &nbsp;, EVA soft Rubber Tyres,</b><b>upgrade 12V10AH battery.<br>Painted Black&nbsp;<br><br></b>Power Wheels&nbsp;<b>Luxury 4 WD Emulatio</b><b>n Ford Style&nbsp;</b>Sport is designed With a big tyres and LCD MP4 For more fun . With Four motors &nbsp;&nbsp;to make it the ultimate driving machine! , does it drive-- in the tough backyard driving conditions including &nbsp;grass ,hard surfaces !<br>&nbsp;And, there’s , MP3 jack, &nbsp;working &nbsp;tailgate, working head lights, &nbsp;seat belts, storage Space ! Drives 3 speeds&nbsp;&nbsp;on Parent remote Control &nbsp;.<b><br><br><br>&nbsp;</b>', '- Moving front and back<br>-Front and back LED lights and searchlightfunction<br>-MP3 connector, USB, SD card socket function <br>-Battery indicator<br>-Emulation Key Start<br>-4 wheel suspension system<br>-2.4G bluetooth remote control system&nbsp;<br>-Gentle start system<br>-3 speed can be adjusted on remote<br>-Two doors can be opened like real carMegnetic door with lockerTwo seater design<br>-charging system 12 Hours&nbsp;<br>Average speed: 3-7 KM /H<br>- Suitable age: 2-6 Years<br>-Car Size: 133*83*73cm (L*W*H)<br>-EVA soft Rubber Tyres<br>-leather seat <br>-MP4 LCD Screen <br>-upgrade to12V10AH battery -<br>&nbsp;-Four Wheel drive&nbsp;<br>-Motor: 45W*4&nbsp;', 'active', NULL, 'Product', NULL, '369.00', '369.00', NULL, NULL, NULL, '20', 'no', 0, 0, '2017-01-01 23:37:22', '2017-01-03 10:28:53', 'Yes', 'uploads/product_image/983NV-X601 EMULATION FORD BLACK PAINT (2).jpg', 'uploads/product_image/thumb_988_NV-X601 EMULATION FORD BLACK PAINT (2).jpg', 'Ford', '2-seater', '12V', '-&nbsp;Moving front and back<br>-Front and back LED lights and searchlightfunction<br>-MP3 connector, USB, SD card socket&nbsp;function&nbsp;<br>-Battery indicator<br>-Emulation Key Start<br>-4 wheel suspension system<br>-2.4G bluetooth remote control system&nbsp;<br>-Gentle start system<br>-3 speed can be adjusted on remote<br>-Two doors can be opened like real carMegnetic door with lockerTwo seater design<br>-charging system 12 Hours&nbsp;<br>Average speed: 3-7 KM /H<br>- Suitable age: 2-6 Years<br>-Car Size: 133*83*73cm (L*W*H)<br>-EVA soft Rubber Tyers&nbsp;<br>-leather seat&nbsp;<br>-MP4 LCD Screen&nbsp;<br>-upgrade to12V10AH battery -<br>&nbsp;-Four Wheel drive&nbsp;<br>-Motor: 45W*4&nbsp;', '', 0, 1, '34.00', NULL, '140.00', '85.00', '60.00', 'none', '', 'no'),
(66, NULL, 3, 7, 'New Two Seats Jeep Style With Rubber EVA soft tyre, leather seat With 2.4 G Remote Control ', 'new-two-seats-jeep-style-with-rubber-eva-soft-tyre-leather-seat-with-24-g-remote-control', '<h3>IN STOCK&nbsp;</h3><h2>New Two Seater Jeep Style With Rubber EVA soft tyre, leather seat With 2.4 G Remote Control&nbsp;<br></h2>The latest ride-on Jeep to hit the AU market - The Two seater&nbsp;12v Ride On Electric Kids Jeep is powered by an impressive 12v battery that''s bigger.This upgraded 2 Seater Model is the biggest and best off-roader we offer!With opening doors and bonnet, &nbsp;USB Port , lights and an MP3 plug in this is the ultimate ride on&nbsp;The external charging socket is easily accessible and can be parked outside of a door/window for speedy charging. Included is a Back wheel can be opened as storage box&nbsp; , so your children can enjoy the fun with this Jeep &nbsp;.This jeep is suitable for ages 2 and over and can be enjoyed safely by any child under 40kg in weight.', '- EVA soft Rubber tyres<br>- leather seat,<br>-&nbsp;Battery &nbsp;: 12V10AH&nbsp;<br>-&nbsp;Motors : 2 X 35 Watt .<br>- -3 points safety belt<br>-Moving Forward and Backward <br>-Back Wheel Shock Absorber System<br>-Doors can be opened and hood can be opened<br>-MP3 connector,USB,memory card socket<br>-Battery Indicator LED front and back lights, fog light, search light <br>-Gentle start system to keep kids safe<br>-2.4G Remote control system<br>-One button start<br>-High Low Speed function<br>-Two seats design and space<br>-Engine cover&nbsp;<br>-Back wheel can be opened as storage box <br>-Average Speed: 3-7 KM <br>-Suitable age:2-6 Years <br>-Carrying handle at the back of car<br>-Car size: 125*80*80 cm<br><br><br><br>', 'active', NULL, 'Product', NULL, '329.00', '329.00', NULL, NULL, NULL, '20', 'no', 0, 0, '2017-01-02 00:39:23', '2017-01-19 04:27:58', 'Yes', 'uploads/product_image/426150.jpg', 'uploads/product_image/thumb_266_150.jpg', 'Jeep', '2-seater', '12V', '-&nbsp;EVA soft Rubber&nbsp;tyres<br>- leather seat,<br>-&nbsp;Battery &nbsp;: 12V10AH&nbsp;<br>-&nbsp;Motors : 2 X 35 Watt .<br>-Moving Forward and Backward&nbsp;<br>-Back Wheel Shock Absorber System<br>-Doors can be opened and hood can be opened<br>-MP3 connector,USB,memory card socket<br>-Battery Indicator&nbsp;LED front and back lights, fog light, search light&nbsp;<br>-Gentle start system to keep kids safe<br>-2.4G Remote control system<br>-One button start<br>-3 points safety belt<br>-High Low Speed function<br>-Two seats design and space<br>-Engine cover&nbsp;<br>-Back&nbsp;wheel can be opened as&nbsp;storage box&nbsp;<br>-Average Speed: 3-7 KM&nbsp;<br>-Suitable age:2-6 Years&nbsp;<br>-Carrying handle at the back of car<br>-Car size: 125*80*80 cm<b></b>', '', 0, 0, '36.00', NULL, '134.00', '75.00', '65.00', 'none', '', 'no'),
(67, NULL, 3, 6, 'Stylish 12 Volt Concept Style Motorbike with fancy lights ', 'stylish-12-volt-concept-style-motorbike-with-fancy-lights', '<b><u>IN STOCK&nbsp;<br><br>Colour ; Red With Black&nbsp;<br></u></b><br>Cleaning up the streets in this cool 3 wheel Ride On&nbsp;Stylish 12 Volt Concept Style Motorbike . Little ones will rule the sidewalk with this kid-sized battery-operated riding toy that can whiz along at up to 6mph with two speeds . This Stylish 12 Volt Concept Style Motorbike ride-on features forward and reverse, hand accelerator, headlight, hazard light, and signal light. There are even cool sound effects too to complete the effect of this fantastic ride on motorcycle,Music function (left handle change music,<div>-right handle fix music volume) with Storage box at bottom of bike .<br><br></div><br><br>', '<div>(Made by aviation magnesium alloy material)<br><br></div><div>-Moving Forward and Backward</div><div>-Full suspension system</div><div>-Music function (left handle change music,</div><div>-right handle fix music volume)</div><div>-Battery Indicator</div><div>-LED fancy lights decoration screen</div><div>-Storage box at bottom of bike</div><div>-Made by aviation magnesium alloy material</div><div>-Fancy lights effect on side logo position</div><div>-One button start</div><div>-With High and Low Speed function<br><div>-Motor: 25W*2</div><div>- Battery: 2 x 6V4.5AH ( 12 Volt )</div></div><div>-Average Speed: 3-5 KM</div><div>-Suitable age: 37-96 month<br>-size: 86*56*47 cm</div>', 'active', NULL, 'Product', NULL, '179.00', '179.00', NULL, NULL, NULL, '10', 'no', 0, 0, '2017-01-02 21:15:43', '2017-01-19 04:26:03', 'Yes', 'uploads/product_image/803ALLOY MOTORBIKE (5).jpg', 'uploads/product_image/thumb_478_ALLOY MOTORBIKE (5).jpg', 'BMW', 'Single-seater', '12V', '<div>(Made by aviation magnesium alloy material)<br><br></div><div>-Moving Forward and Backward</div><div>-Full suspension system</div><div>-Music function (left handle change music,</div><div>-right handle fix music volumn)</div><div>-Battery Indicator</div><div>-LED fancy lights decoration screen</div><div>-Storage box at bottom of bike</div><div>-Made by aviation magnesium alloy material</div><div>-Fancy lights effect on side logo position</div><div>-One button start</div><div>-With High and Low Speed function</div><div>-Average Speed: 3-5 KM</div><div>-Suitable age: 37-96 month<br>-size: 86*56*47 cm</div>', '', 0, 0, '15.00', NULL, '100.00', '60.00', '40.00', 'none', '', 'no');
